INSERT INTO `#__review_detail` (`detail_id`, `review_id`, `store_id`, `title`, `detail`, `nickname`, `customer_id`) VALUES
(1, 1, 1, 'Awesome', 'Although i was hoping it would be already strung in, it was very awesome. Good material, not lace string which is good to me, and thank you for writing reccomended sizes because i bought another one thinking it was my size and it didnt work. So this product was pretty good. ', 'Kai', NULL),
(2, 2, 1, 'Very trendy', 'Down the road, as the drive to decarbonize energy continues, as more places move to an energy mix similar to Sweden (or even greener) the balance for this sort of reading is likely to shift even more strongly towards favoring online.', 'Customer', NULL),
(3, 3, 1, 'How sexy', 'I loved how sexy this is! It fit great and looks great on! My husband was very pleased as well.', 'Lizy', NULL),
(4, 4, 1, 'Great design', 'This is a great addition to my ''wardrobe''. :) I am a size 16/18, wearing a 38DD. The size I ordered is a little big. I did try to tighten it up, but it only goes so far. If/when I order again, I will be getting a size smaller. I don''t want it to be moving around or side to side when I''m wearing it. Otherwise, its a beautiful corset and he LOVES seeing me in it. :) ', 'Shannonz76', NULL),
(5, 5, 1, 'Really cute', 'This swimsuit is really cute. The reason I gave it 3 stars is because of lack of breast support. I took the suit to my seamstress she put in push up padding with a underwire which is much better then the little bit of very light padding the suit has. To help others order their size I am 5''8 130lbs 36c ...medium fits me well every where. ', 'Betty', NULL),
(6, 6, 1, 'Wrong size', 'The sizing is not as described. I think it is made to a tall, long torsoed woman, and straps are too long ', 'Marish', NULL),
(7, 7, 1, 'Very cute though', 'Going on vacation to Cabo and wanted a cute bathing suit. We ordered this and found out it was coming from hong kong and so probably wouldn''t get it before we left. It came last night and i immediately tried it on. I had no problem with the top being a bit small but the bottoms were way too low cut!!! Not only in the front but in the back too!! I can''t wear this out in public! Built for a tiny tiny framed person!! Very cute though! ', 'Joe Eley', NULL),
(8, 8, 1, 'My wife loves it', 'I bought this for my wife, she liked it upon looking at it, comfortable on the skin and to sleep in, not use the G String just the top.', 'rockero', NULL);
